    - type: Paper
      content: >-
        Greetings our trustworthy engineer!

                 This is a [bold]T[/bold]hermo[bold]e[/bold]lectric [bold]G[/bold]enerator. ([bold]TEG[/bold])
        [color=red][bold]O[/bold]pen Hot Loop[/color] / [color=blue][bold]C[/bold]losed Cold Loop[/color] variant. ([bold]TEG/[color=red]O[/color]-[color=blue]C[/color][/bold])

        One of the most reliable power sources, because once its set, it works until the rest of the shift. 
                 If you are unfamiliar with TEGs, is is HIGHLY recommended to ask your seniors for directions and explanations. In case there are no quialified seniors, we have prepared the manual.

        [color=red]Red pipes mark the Hot loop.[/color]

        [color=blue]Blue pipes mark the Cold loop.[/color]


        [bold][color=red]Hot loop[/color][/bold]

        [bullet][bold]Gas mixer:[/bold]

        The mix is recomended to be [color=orange]3% plasma[/color] and [color=cyan]97% oxygen[/color]. You can start with 2 [color=cyan]oxygen cannisters[/color], but should soon connect an [color=cyan]oxygen pipe[/color] into the mix.

        One atmosphere pressure (101.13kPa) is perfectly fine to use.


        [bullet][bold]Pump into burn chamber: [/bold]

        Put it at 20 L/S. Turn it on.


        [bullet][bold]Burn chamber:[/bold]

        Find the remote for the igniter in the burn chamber and press it to start the burn.

        It's recomended you let the chamber fully ignite fully until no fire is present before you continue to the next step.


        [bullet][bold]Volumetric pump into TEG:[/bold]

        Put it at 200 L/S (maximum). Turn it on.


        [bullet][bold]Gas pump into space:[/bold]

        Put it at 4500 kPa (maximum). Turn it on.


        --------


        [bold][color=blue]Cold loop[/color][/bold]

        [bullet][bold]Connector port[/bold]

        Anchor a nitrogen canister onto the connector port.


        [bullet][bold]Pump from connector[/bold]

        Turn on the pump at 4500 kPa.


        [bullet][bold]Freezer[/bold]

        Set to minimum temperature possible. 

        Inputing 0 will automatically clamp the value to its minimum.

        Turn on the freezer.


        [bullet][bold]Volumectric pump to circulator[/bold]

        Put it at 200 L/S (maximum). Turn it on.


        [bullet][bold]Gas pump to radiators[/bold]

        Put it at 4500 kPa (maximum). Turn it on.


        ---------


        [bold]NOTE[/bold]

        TEG requires start up power.

        [color=orange]In case of power outage[/color], you will have to power this room with a J.R.P.A.C.M.A.N. generator.

        Anchor the generator onto the low voltage wires related to TEG's APC.

        Fill in the generator with welding fuel.

        Pull the generator's chord to start.


        There are many TEG designs.

        This is one of the more efficient designs and it will do good in the long run.


        It is estimated that with constant oxygen flow and one plasma canister of ~1800 mols will let TEG/O-C run for ~3 hours, if tuned to optimal power production for station with power demand of ~250kW.


        To tune TEG to optimal settings you will be mostly looking at the open hot loop's [color=red]volumetric pump into TEG[/color].

        Lower the pump's flow rate until TEG's power generation drops. Lightly increase the flow rate so the power generation meets the demand.


        Good luck!
